import React, {Component} from 'react';
import '../static/css/Navbar.css';

class Navbar extends Component {

  goHome(){

  }

  render(){
    return(
        <header>
          <ul className='navBar'>
            <button className='btn btn-one' onClick={this.goHome}>Home</button>
            <button className='btn btn-one' onClick={this.goAbout}>About me</button>
            <button className='btn btn-one' onClick={this.goContact}>Contact</button>
            <a href="#hello" class="button">Hover me</a>
          </ul>
        </header>
    );
  }
}

export default Navbar;
